window.bookSummaryJSON = "<p><b>Innocent. Blameless. Pure. Heartbroken. Josie Vos belonged to the one family I hated more than anything.</b></p> <p>And I had forced her to despise me just as much. It didn't matter that I had lost track of my plan and fallen for my enemy. Irrevocably hurt and enraged by my deceit, she had no intentions of doing anything but watching me lose my throne.</p> <p>The secrets of our families can never be forgotten.</p> <p>I knew that from the beginning, but I refuse to allow the sins of our families to determine our future. I should have left her alone and let her hate me. I didn't. I was going to fight for her, even if she now held all the power.</p>"; 
